function initMap() {
    console.log('Loading Map...');
    const permits = temp_data["Records"];

    var Stadia_AlidadeSmooth = L.tileLayer('https://tiles.stadiamaps.com/tiles/alidade_smooth/{z}/{x}/{y}{r}.png', {
        maxZoom: 20
        /*attribution: '&copy; <a href="https://stadiamaps.com/">Stadia Maps</a>, &copy; <a href="https://openmaptiles.org/">OpenMapTiles</a> &copy; <a href="http://openstreetmap.org">OpenStreetMap</a> contributors'*/
    });
    var Stadia_AlidadeSmoothDark = L.tileLayer('https://tiles.stadiamaps.com/tiles/alidade_smooth_dark/{z}/{x}/{y}{r}.png', {
        maxZoom: 20,
        attribution: '&copy; <a href="https://stadiamaps.com/">Stadia Maps</a>, &copy; <a href="https://openmaptiles.org/">OpenMapTiles</a> &copy; <a href="http://openstreetmap.org">OpenStreetMap</a> contributors'
    });

    var NeighborHoodCouncil = getNHCLayer();

    var dtla = new L.latLng({ lat: 33.954372, lon: -118.376021 });
    var mymap = new L.map('mapid',
        {
            //Setup mymap's attributes
            zoomControl: true,
            layers: [Stadia_AlidadeSmooth, NeighborHoodCouncil],
        }).setView([34.0, -118.38], 9, {
            reset: true
        });
    //Stadia_AlidadeSmoothDark.addTo(mymap);
    //NeighborHoodCouncil.addTo(mymap);

    for (let permit of permits) {
        if (permit["latitude"] != null && (permit["longitude"])) {
            L.marker([permit["latitude"], permit["longitude"]]).addTo(mymap).bindPopup(permit["full_address"]);
        }
    }

    console.log('Successfully Loaded Map...');
}

